import{_ as e,a,b as r}from"./chunks/pinmap_bottom.B5byofUn.js";import{_ as l,c as o,a8 as i,o as s}from"./chunks/framework.BDnHobkS.js";const k=JSON.parse('{"title":"ThePeach FCC-K1","description":"","frontmatter":{},"headers":[],"relativePath":"uk/flight_controller/thepeach_k1.md","filePath":"uk/flight_controller/thepeach_k1.md"}'),d={name:"uk/flight_controller/thepeach_k1.md"};function n(p,t,h,c,u,g){return s(),o("div",null,t[0]||(t[0]=[i('<h1 id="thepeach-fcc-k1" tabindex="-1">ThePeach FCC-K1 <a class="header-anchor" href="#thepeach-fcc-k1" aria-label="Permalink to &quot;ThePeach FCC-K1&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 не розробляє цей (або будь-який інший) автопілот. Contact the <a href="https://thepeach.kr/" target="_blank" rel="noreferrer">manufacturer</a> for hardware support or compliance issues.</p></div><p><strong>ThePeach FCC-K1</strong> is an advanced autopilot designed and manufactured in <strong>ThePeach</strong>.</p><p>It is based on the <strong>Pixhawk-project FMUv3</strong> open hardware design and runs <strong>PX4</strong> on <strong>Nuttx OS</strong>.</p><p><img src="'+e+'" alt="ThePeach FCC-K1"></p><h2 id="характеристики" tabindex="-1">Характеристики <a class="header-anchor" href="#характеристики" aria-label="Permalink to &quot;Характеристики&quot;">​</a></h2><ul><li><p>Основний процесор: STM32F427VIT6</p><ul><li>32-бітний ARM Cortex-M4, 168 МГц 256 КБ ОЗП 2 МБ флеш-пам&#39;яті</li></ul></li><li><p>IO процесор: STM32F100C8T6</p><ul><li>ARM Cortex-M3, 32 бітний ARM Cortex-M3, 24 МГц, 8КБ SRAM</li></ul></li><li><p>Сенсори на платі</p><ul><li>Акселератор/гіроскоп: ICM-20602</li><li>Акселератор/гіроскоп/Магнітометр: MPU-9250</li><li>Барометр: MS5611</li></ul></li><li><p>Інтерфейси</p><ul><li>8+5 PWM виходів (8 з IO, 5 з FMU)</li><li>Spektrum DSM / DSM2 / DSM-X Satellite сумісний вхід</li><li>Futaba S.BUS сумісний вхід та вихід</li><li>Вхід сигналу PPM sum</li><li>Аналоговий / PWM вхід RSSI</li><li>Вихід сервоприводу S.Bus</li><li>Запобіжний вимикач / LED</li><li>4x Порти UART: TELEM1, TELEM2, GPS, SERIAL4</li><li>2x I2C порти</li><li>1x CAN шина</li><li>1x ADC</li><li>Аналогові входи для напруги / струму з 1 батареї</li></ul></li><li><p>Деталі механічної частини</p><ul><li>Розміри: 40.2 x 61.1 x 24.8 mm</li><li>Вага: 65г</li></ul></li></ul><h2 id="з-єднання" tabindex="-1">З’єднання <a class="header-anchor" href="#з-єднання" aria-label="Permalink to &quot;З’єднання&quot;">​</a></h2><p><img src="'+a+'" alt="pinmaptop"></p><p><img src="'+r+'" alt="pinmapbottom"></p><h2 id="налаштування-послідовного-порту" tabindex="-1">Налаштування послідовного порту <a class="header-anchor" href="#налаштування-послідовного-порту" aria-label="Permalink to &quot;Налаштування послідовного порту&quot;">​</a></h2><table tabindex="0"><thead><tr><th>UART</th><th>Пристрій</th><th>Порт</th></tr></thead><tbody><tr><td>USART1</td><td>/dev/ttyS0</td><td>Відладка процесора вводу-виводу</td></tr><tr><td>USART2</td><td>/dev/ttyS1</td><td>TELEM1 (керування потоком)</td></tr><tr><td>USART3</td><td>/dev/ttyS2</td><td>TELEM2 (керування потоком)</td></tr><tr><td>UART4</td><td>/dev/ttyS3</td><td>GPS1</td></tr><tr><td>USART6</td><td>/dev/ttyS4</td><td>PX4IO</td></tr><tr><td>UART7</td><td>/dev/ttyS5</td><td>Debug Console</td></tr><tr><td>UART8</td><td>/dev/ttyS6</td><td>TELEM4</td></tr></tbody></table><h2 id="номінальна-напруга" tabindex="-1">Номінальна напруга <a class="header-anchor" href="#номінальна-напруга" aria-label="Permalink to &quot;Номінальна напруга&quot;">​</a></h2><p><strong>ThePeach FCC-K1</strong> can be double-redundant on the power supply if two power sources are supplied. The two power rails are: <strong>POWER</strong> and <strong>USB</strong>.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The output power rails <strong>FMU PWM OUT</strong> and <strong>I/O PWM OUT</strong> do not power the flight controller board (and are not powered by it). You must supply power to one of <strong>POWER</strong> or <strong>USB</strong> or the board will be unpowered.</p></div><p><strong>Normal Operation Maximum Ratings</strong></p><p>За таких умов всі джерела живлення будуть використовуватися в цьому порядку для живлення системи:</p><ol><li>POWER вхід (5В до 5.5В)</li><li>USB вхід (4.75В до 5.25В)</li></ol><p><strong>Absolute Maximum Ratings</strong></p><p>За таких умов всі джерела живлення спричиняють постійні пошкодження контролеру польоту.</p><ol><li>POWER вхід (більше 5.5В)</li><li>USB вхід (більше 5.5В)</li></ol><h2 id="збірка-прошивки" tabindex="-1">Збірка прошивки <a class="header-anchor" href="#збірка-прошивки" aria-label="Permalink to &quot;Збірка прошивки&quot;">​</a></h2><p>Щоб зібрати PX4 для цього контролера:</p><div class="language-jsx vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">jsx</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">make thepeach_k1_default</span></span></code></pre></div><h2 id="де-купити" tabindex="-1">Де купити <a class="header-anchor" href="#де-купити" aria-label="Permalink to &quot;Де купити&quot;">​</a></h2><p>Order from <a href="http://thepeach.shop/" target="_blank" rel="noreferrer">ThePeach</a></p>',26)]))}const P=l(d,[["render",n]]);export{k as __pageData,P as default};
